pragma solidity >0.4.99 <0.6.0;

contract ShareApp{

   //租借者信息
	struct Renter{
		address payable addr;    //租借者地址
		uint since;      //租借开始时间
	}

    //物品信息
	struct Object{
		address payable creator; // 物品拥有者
		string name;    //物品名称
		uint priceDaily;  //出租物品单价
		uint deposit;     //共享物品押金
		Renter renter;    //租借者
		bool rented;      //是否被租借
		string detail;    //物品详情
		string image_addr; //物品图片地址
	}

	struct NameKey{ // storage the name's keys
		uint[] keys;
	}

	//物品列表
	uint[] private ids;  //Use it to return the ids of Objects
	uint public numObjects;  //物品数量
	mapping(uint => Object) private objects;   //物品Id到物品结构体的映射
	mapping(string => NameKey) private nameToKeys;     

	address public owner;

	//E创建新物品时的事件
	event NewObject(uint objID, address creator);

//   //非法的物品id
//     require(objID < numObjects);


//   //这个条件的内容是假设发送者不是owner（管理者），就跳出。起到一个身份鉴别的作用。
//     require(msg.sender == owner);




	//构造函数，用于存储代币的管理者
	constructor() public{
     	owner = msg.sender;
    } 



    //
	function  objectIsRented(uint objID)  public returns (bool){
		return objects[objID].rented;
	}

    //创建新的物品
	function createObj(string memory name,uint priceDaily,uint deposit,string memory detail,string memory addr) public {

//      address creator; // 物品拥有者
// 		string name;    //物品名称
// 		uint priceDaily;  //出租物品单价
// 		uint deposit;     //共享物品押金
// 		Renter renter;    //租借者
// 		bool rented;      //是否被租借
// 		string detail;    //物品详情
// 		string image_addr; //物品图片地址



		Object memory  newObject = objects[numObjects];
		nameToKeys[name].keys.push(numObjects); //add the key to the name's keys

		newObject.creator = msg.sender;
		newObject.name = name;
		newObject.priceDaily = priceDaily;
		newObject.deposit = deposit;
		newObject.rented = false;
		newObject.detail = detail;
        newObject.image_addr = addr;

		emit NewObject(numObjects,msg.sender);
		ids.push(numObjects);
		numObjects++;
	}

   	// function getAllObject() view returns(Object[]){
   	//     Object [] temp = new Object[](numObjects);
   	//     for(uint 1=0;i<numObjects;i++)
   	//     {
   	//         temp[i] = 
   	//     }

   	// }

    //归还
	function rentObj(uint objID) payable public returns(bool){
		if(objectIsRented(objID) || msg.value < objects[objID].deposit || msg.sender == objects[objID].creator){
			revert(); 
		}
		objects[objID].renter = Renter({addr:msg.sender, since:now});  //record the info of the renter
		uint rest = msg.value - objects[objID].deposit;
		if(!objects[objID].renter.addr.send(rest)){   // return the rest balance
		   revert(); 
		}
		objects[objID].rented = true;
		return true;
	}

	function returnObj(uint objID) payable public returns (bool){
		if(!objects[objID].rented){
		    revert(); 
		}
		if(objects[objID].renter.addr != msg.sender){
			revert(); 
		}
		uint duration = (now - objects[objID].renter.since) / (24*60*60*1.0);
		uint charge = duration * objects[objID].priceDaily;
		if(!objects[objID].creator.send(charge)){
			revert(); 
		}
		if(!objects[objID].renter.addr.send(objects[objID].deposit - charge)){
			revert(); 
		}
		delete objects[objID].renter;
		objects[objID].rented = false;
	}


	function findNames(string memory name) view public returns(uint[] memory){
		return nameToKeys[name].keys;
	}

	function getNumObjects() public returns(uint){
		return numObjects;
	}

	function getObjectIds() public returns(uint[] memory){
		return ids;
	}

	function getObjectName(uint objID) public returns(string memory objName){
		Object memory obj  = objects[objID];
		objName = obj.name;
	}

	function getObjectCreator(uint objID) view public returns(address){
		return objects[objID].creator;
	}

	function getObjectPriceDaily(uint objID) view public  returns(uint){
		return objects[objID].priceDaily;
	}

	function getObjectDeposit(uint objID) view public  returns(uint){
		return objects[objID].deposit;
	}

	function getObjectRenterAddress(uint objID) view public returns(address){
		return objects[objID].renter.addr;
	}

	function getObjectRenterSince(uint objID) view public  returns(uint){
		return objects[objID].renter.since;
	}

	function getObjectDetail(uint objID) view public returns(string memory){
		return objects[objID].detail;
	}

// 	function remove() public {
// 	    assert(msg.sender == owner);
// 			selfdestruct(owner);
// 			// suicide(owner);
// 	}
}
